import React from "react";
import Single from "../assets/single.png";
import Double from "../assets/double.png";
import Triple from "../assets/triple.png";

const Cards = () => {
  return (
    <div className="bg-white py-[10rem] px-4">
      <div className="max-w-[1240px] grid md:grid-cols-3 gap-8">
        <div className="p-5 bg-red-400 flex flex-col justify-center items-center">
          <img src={Single} className="w-20 bg-white" />
          <h1>Single User</h1>
          <p>$149</p>
          <div>
            <p>500 GB Sotrage</p>
            <p>1 Granted User</p>
            <p>Sned up to 2 GB</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cards;
